  async exportExcel(event: LazyLoadEvent) {

    this.loginService.validaToken();

    if (event.sortField == undefined) {
      event.sortField = 'razaosocial';
      event.sortOrder = 0;
    }
    if (event.globalFilter == undefined) {
      if (this.requisicaoService.dt22 != '') {
        event.globalFilter = this.dt22;
      } else {
        event.globalFilter = 'undefined';
      }
    }

    //    console.log("event = " + JSON.stringify(event));
    for (let prop in event.filters) {
      console.log("prop" + JSON.stringify(prop));
      if (prop == 'global') {
        //        this.idimovel = '0'
      } else {
        let filterField: string = prop;
        //        console.log("filterField " + JSON.stringify(filterField));
        let filterMeta = event.filters[filterField];
        //      console.log("filterMeta " + JSON.stringify(filterMeta[0].value));
        if (filterMeta[0].value == null) {
          this.idimovel = '0';
          //      console.log("this.idimovel true " + this.idimovel);
        } else {
          this.idimovel = JSON.stringify(filterMeta[0].value.idimovel);
          //    console.log("this.idimovel false " + this.idimovel);
        }
      }
      //     this.idimovel = JSON.stringify(filterMeta[0].value.idimovel);
    }
    event.first = 0;
    event.rows = 9999999;

    await this.requisicaoService.consultaRequisicaos(event.first, event.rows, event.sortField, event.sortOrder, event.globalFilter, this.idimovel);
    //  await this.requisicaoService.getRequisicaogeral();
    this.requisicaos = this.requisicaoService.requisicaos;

    pdfmake.vfs = pdfFonts.pdfMake.vfs;
    this.cabec = [];
    this.linha = [];
    this.Heading = [];
    this.lista = [];

    for (let x = 0; x < this.selectedColumns.length; x++) {
      this.cabec[x] = this.selectedColumns[x].header;
    }
    this.Heading.push(this.cabec);

    for (let i = 0; i < this.requisicaos.length; i++) {
      this.linha = [];
      for (let x = 0; x < this.selectedColumns.length; x++) {
        if (this.selectedColumns[x].type == 'string') {
          this.linha[x] = this.requisicaos[i][this.selectedColumns[x].field];
        }
        if (this.selectedColumns[x].type == 'soma') {
          this.linha[x] = this.currencyPipe.transform(this.requisicaos[i][this.selectedColumns[x].agregado2], 'BRL', true, '1.2-2');
//          this.linha[x] = this.requisicaos[i][this.selectedColumns[x].agregado2].replace('.', ',');
        }
        if (this.selectedColumns[x].type == 'date') {
          if (this.requisicaos[i][this.selectedColumns[x].field] == null) {
            this.dtviginicio = '';
          } else {
            this.dtviginicio = new Date(this.requisicaos[i][this.selectedColumns[x].field]).toLocaleDateString();
          }
          this.linha[x] = this.dtviginicio;
        }
        if (this.selectedColumns[x].type == 'date1') {
          if (this.requisicaos[i][this.selectedColumns[x].field] == null) {
            this.dtviginicio = '';
          } else {
            this.dtviginicio = new Date(this.requisicaos[i][this.selectedColumns[x].field]).toLocaleDateString();
          }
          this.linha[x] = this.dtviginicio;
        }
        if (this.selectedColumns[x].type == 'agregate1') {
          this.linha[x] = this.requisicaos[i][this.selectedColumns[x].field][this.selectedColumns[x].agregado1];
        }
        if (this.selectedColumns[x].type == 'agregate2') {
          this.linha[x] = this.requisicaos[i][this.selectedColumns[x].field][this.selectedColumns[x].agregado1][this.selectedColumns[x].agregado2];
        }
        if (this.selectedColumns[x].type == 'status') {
          if (this.requisicaos[i][this.selectedColumns[x].field]) {
            this.linha[x] = 'Sim';
          } else {
            this.linha[x] = 'NÃ£o';
          }
        }
        if (this.selectedColumns[x].type == 'stcontrato') {
          if (this.requisicaos[i][this.selectedColumns[x].field] == 'C') {
            this.linha[x] = 'Compra';
          } else {
            if (this.requisicaos[i][this.selectedColumns[x].field] == 'A') {
              this.linha[x] = 'Aprovado';
            } else {
              this.linha[x] = 'Reprovado';
            }
          }
        }
      }

      this.lista.push(this.linha);

    }

    import("xlsx").then(xlsx => {
      const workbook = xlsx.utils.book_new();
      const worksheet = xlsx.utils.json_to_sheet([]);
      xlsx.utils.sheet_add_aoa(worksheet, this.Heading, { origin: 'A2' });
      xlsx.utils.sheet_add_json(worksheet, this.lista, { origin: 'A3', skipHeader: true, });
      xlsx.utils.book_append_sheet(workbook, worksheet, 'Requisicaos');
      const excelBuffer: any = xlsx.write(workbook, { bookType: 'xlsx', type: 'array' });
      this.saveAsExcelFile(excelBuffer, `requisicaos`);
    });

  }

  saveAsExcelFile(buffer: any, fileName: string): void {
    let EXCEL_TYPE = 'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet;charset=UTF-8';
    let EXCEL_EXTENSION = '.xlsx';
    const data: Blob = new Blob([buffer], {
      type: EXCEL_TYPE
    });
    FileSaver.saveAs(data, fileName + '_export_' + new Date().getTime() + EXCEL_EXTENSION);
  }





